/* RABBIT GUN */
  Thread t = new Thread(() =>
  {
   while (robotManager.Products.Products.IsStarted)
   {
    if (Conditions.InGameAndConnectedAndAliveAndProductStartedNotInPause)
    {
     if (!Questing.Has(39656))
      break;

     var howler = ObjectManager.GetWoWUnitHostile().Where(u => u.IsTargetingMeOrMyPet && (u.Entry == 98273 || u.Entry == 94098)).OrderBy(u => u.GetDistance).FirstOrDefault();
     if (howler != null && howler.IsValid && howler.GetDistance < 25)
     {
      ItemsManager.UseItem(128651);
      Thread.Sleep(Usefuls.Latency * 2);
      ClickOnTerrain.Pulse(howler.Position);
      Usefuls.WaitIsCasting();
     }
    }
    Thread.Sleep(1000);
   }
  });
  t.Start();

