public class GoingDownGoingUp : QuestClass
{
	public GoingDownGoingUp()
	{
		Name = "Going Down, Going Up";
		QuestId.Add(42425);
		Step.AddRange(new[] { 1 });
	}
	public override bool Pulse()
	{
		Conditions.ForceIgnoreIsAttacked = true;
		if (!ObjectManager.Me.PlayerUsingVehicle)
		{
			Questing.MovementDisabled = false;
			var p0 = new Vector3(5110.403, 4194.36, 684.1993);
			GoToTask.ToPositionAndIntecractWithNpc(p0, 107415);
			return true;
		}
		Questing.MovementDisabled = true;
		var p = new Vector3(5114.13, 4199.023, 437.4173);
		var loot = Questing.FindObject(250413);
		if (loot != null && loot.IsValid && loot.GetDistance < 10)
		{
			Interact.InteractGameObject(loot.GetBaseAddress);
			Usefuls.WaitIsCasting();
		}
		return true;
	}

}

