public class EmptyNest : QuestClass
{
	List<Vector3> _turnInHotspots = new List<Vector3>()
	{
		new Vector3(5202.339, 4044.996, 791.7585, "None"),
		new Vector3(5276.498, 4129.651, 747.2562, "None"),
	};

	public EmptyNest()
	{
		Name = "Empty Nest";
		QuestId.Add(39305);
		Step.AddRange(new[] { 1 });
	}

	public override bool Pulse()
	{
		var p = new Vector3(5229.377, 4036.642, 822.5257);
		Questing.Gather(p, 244419);
		return true;
	}

	public override bool TurnIn()
	{
		if (Questing.FindNPC(NpcTurnIn, _turnInHotspots))
			return base.TurnIn();

		return true;
	}

}

