public class MurlocsTheNextGeneration : QuestClass
{
	protected List<Vector3> _hotspots = new List<Vector3>()
	{
		new Vector3(6405.149, 4337.525, 35.24731, "None"),
		new Vector3(6376.041, 4351.041, 39.67204, "None"),
		new Vector3(6368.557, 4288.985, 54.15285, "None"),
		new Vector3(6368.473, 4247.944, 55.79154, "None"),
		new Vector3(6377.451, 4195.979, 56.30812, "None"),
	};
	protected List<int> _mobs = new List<int>()
	{
		98194,
	};
	public MurlocsTheNextGeneration()
	{
		Name = "Murlocs: The Next Generation";
		QuestId.Add(40102);
		Step.AddRange(new[] { 1, 10 });
	}
	public override bool Pulse()
	{
		if (Murky.MountVehicle())
			return true;

		if (Murky.TryCombat())
			return true;

		if (Murky.TryFind(_mobs, _hotspots))
			return true;

		return true;
	}
	public override bool IsComplete()
	{
		return Questing.ObjectiveComplete(this, 2);
	}

}

